import ErrorImg from 'public/images/p5.jpg';

export default function MessageBox(props) {
  return (
    <div>
      <Alert variant={props.variant || 'info'}>{props.children}</Alert>
      <img src={ErrorImg} alt="404" />
    </div>
  );
}
